INSERT INTO `v1_ba028275fe08c2edbfe9030d95b42a263281a77c5eddfa7195554cf42db57c5f` VALUES (0.75, "ツムギのボトルキャップ", 0.625, 1, 11601, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。", 6);
INSERT INTO `v1_ba028275fe08c2edbfe9030d95b42a263281a77c5eddfa7195554cf42db57c5f` VALUES (0.75, "ツムギのサマーボトルキャップ", 0.625, 1, 11602, "サマー衣装のツムギが、キャップでオンステージ！涼しげな衣装を\nまとい、熱いステージを繰り広げた彼女の勇姿を思い出すことがで\nきる。", 6);
